column8:
ジムニーJB23の各年式車に装着可能。<br>
ノーマルバンパー車には無加工（一部ビス止め用の穴開け要）<br>
社外品バンパーにはバンパーの上下幅に合わせて<br>
加工が必要な場合があります。<br>
限定車にも装備されている純正オプションの<br>
サイドアンダーガーニッシュとの同時装着はできません。<br>
純正のフェンダー モールよりも9ミリ幅広で、<br>
3インチアップ仕様車に225/75R-16サイズのタイヤが<br>
装着可能となります。<br><br>
国が定める「指定部品」ではございませんが、一定範囲内<br>
（片側1cm 車幅で2cm以内）のサイズで製作しております。<br>
しかし、無条件に車検に適合できるわけではございません。<br>
車検に通る 通らないは現場の検査官の判断次第であることをご理解ください。<br>
FRP製ブラック ゲルコート仕上げの要塗装品です<br>（写真はボディー同色塗装済の商品です）<br>
人気商品ですので在庫を確保するように努めておりますが、<br>
立て続けにご注文をいただいた場合、<br>
納期が掛かる場合がありますので、<br>
お急ぎの場合は先にお確かめの上ご注文ください。<br>
<FONT COLOR="#FF0000"></FONT><br><br>
FRP製品のゲルコート仕上げとは、表面を平面に仕上げ、<br>
塗装をしやすくするもので、あくまで塗装を前提とした仕上げです。<br>
塗装せずに長年放置すると、<br>
表面が白く粉を吹いたようになってしまいます。<!-- ここから リア受 -->
