弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。ジムニーJA11の2型以降車にボルトオンの<br>
純正リプレイス グリルのメッキタイプです。<br>
取り付けには若干の加工が必要です。<br>
（グリル端に付くボディーに刺さる4本のピンが<br>
純正よりもやや太いためスムーズに取り付けできません。<br>
ボディー側の穴をやや大きく削っていただく必要があります。<br>
グリル側のピンを削るとメッキが剥がれやすくなる恐れがあります）<br>
中央のスズキ エンブレムは付属しません。<br>
裏側の取り付けステーと合わせて純正を移植再利用してください。<br>
台湾製。<br>
JA71やJA11の1型に取り付けの際に必要な純正パーツ<br>
ステー72116-57C10X2個<br>
ビス  03541-04165X4本<br>
ビス  03541-04103X4本<br>
ビス受09148-04033X4個<br>
全車共通の純正Sマークの品番は2種類あります。<br>
クローム仕様77811-60A00-OPG<br>
通常品    77811-60A00-D56<br><br>送料区分 ： 180<!-- ここから リア受 -->
